import request from '@/utils/request';
export function addRecords(data) {
  //保存
  return request({
    url: "/iwms/outStocks",
    method: 'post',
    data: data
  });
}
export function query(query) {
  //凭证号
  return request({
    url: "/iwms/outStocks",
    method: 'get',
    params: query
  });
}
export function queryDetails(query, outOrderNumber) {
  //凭证号明细
  return request({
    url: "/iwms/outStocks/".concat(outOrderNumber, "/details"),
    method: 'get',
    params: query
  });
}
